def aupton(terms):
  up, dn, alst = [0] + [1]*9, [0] + [1]*9, [9]
  for n in range(2, terms+1):
    up_next = [sum(dn[j] for j in range(i)) for i in range(10)]
    dn_next = [sum(up[j] for j in range(i+1, 10)) for i in range(10)]
    up, dn = up_next, dn_next
    alst.append(sum(up + dn))
  return alst
